import Items from "./Items";

const ViewCart = (WrappedComponent: React.Component) => {
  const WithFlash = () => {
    const { messages, showFlash, clearMessage } = Items();

    return (
      <WrappedComponent
        messages={messages}
      />
    );
  };

  return WithFlash;
};
export default ViewCart;


